import React from "react";
import { View, Text } from "react-native";
const DateTime = () => {
  return (
    <View>
      <View>
        <View>
          <Text>12:12</Text>
        </View>
      <View>
        <Text>Vendredi 30 Juin</Text>
      </View>
      <View>
        
      </View>
      </View>
      <View></View>
    </View>
  );
};

export default DateTime;
